حمزة والكسائي(يَبْشُرُك)، الباقون(يُبَشِّرُك)، هما لغتان: بَشَرَ، يَبْشُر، وبَشَّرَ، يُبَشِّر، قال شاعر:
فأعِنهمُ وابشُرْ بما بَشَروا بهِ
وإذا همُ نزلوا بضَنكٍ فانزِلِ
وقال آخر:
بَشَرْتُ عِيالي إذ رأيتُ صحيفةً
أتتكَ من الحَجّاج يُتلى كتابُها
